import React from 'react';
import './App.css';
// import { Button } from 'react-bootstrap';

var string = [];
var string2 = [];


function App() {
  function insertNumber(number){
    string.push(number);
  }
  return (

    <div className="App">
      <div className='table'>
        <div className='header-row'>
          <input disabled className='display'></input>
        </div>
        <div className='row'>
          <button className='buttons'><p className='buttons-content' onClick={()=> insertNumber(1)}>1</p></button>
          <button className='buttons'><p className='buttons-content' onClick={()=> insertNumber(2)}>2</p></button>
          <button className='buttons'><p className='buttons-content' onClick={()=> insertNumber(3)}>3</p></button>
          <button className='buttons'><p className='buttons-content'>+</p></button>
          <button className='buttons'><p className='buttons-content'>/</p></button>
        </div>
        <div className='row'>
          <button className='buttons'><p className='buttons-content' onClick={()=> insertNumber(4)}>4</p></button>
          <button className='buttons'><p className='buttons-content' onClick={()=> insertNumber(5)}>5</p></button>
          <button className='buttons'><p className='buttons-content' onClick={()=> insertNumber(6)}>6</p></button>
          <button className='buttons'><p className='buttons-content'>-</p></button>
          <button className='buttons'><p className='buttons-content'>=</p></button>
        </div>
        <div className='row'>
          <button className='buttons'><p className='buttons-content' onClick={()=> insertNumber(7)}>7</p></button>
          <button className='buttons'><p className='buttons-content' onClick={()=> insertNumber(8)}>8</p></button>
          <button className='buttons'><p className='buttons-content' onClick={()=> insertNumber(9)}>9</p></button>
          <button className='buttons'><p className='buttons-content'>*</p></button>
          <button className='buttons'><p className='buttons-content'>CE</p></button>
        </div>
      </div>
    </div>
  );
}

export default App;
